import React from "react";
function ProductComponent(props){
  return (
    <div>
    <h2>Name : {props.name}</h2>
    <h3>Price : {props.price}</h3>
    <br/>
    <p>Description ; {props.description}</p>
    </div>
  )
}
export default ProductComponent;
